// #theo như ta thấy các bảng điểm trên ở các tỉnh bắc trung nam
// #Cở sở lập luận đầu tiên : Điêm môn nào trong 3 tỉnh, tỉnh nào cao nhất, tỉnh nào cao nhất. Tại sao?
// // ###-Ta thấy mặt bằng điểm trung của môn lý, hóa là khá là thấp so với các môn khác ở cả ba tỉnh
# - Đối với môn hóa: cao nhất là TP HCM là trung bình 3.67; Thấp nhất là HA NOi 1.7 điểm.
# - Đối với môn Lý: cao nhất là TP HCM trung bình khoảng 3.5; Thấp nhất là Hà Nội trung bình khoảng 1.7
# -> Lý do có thể là do môn này là môn tự nhiên, có độ khó cao so với môn khác, lý thuyết trừu tượng khó tiếp cận với nhiều sinh viên.
// #Cở sở lập luận 2 : mặt bằng chung môn nào giữ mức điểm cao đều trong cả 3 tỉnh?
// ###-Môn toán là môn mà môn cả 3 tỉnh đều giữ được mức cao chung trong cả 3 tỉnh. Lý đó có thể là do đa số môn toán là môn chính và là môn để có trong các khối xét thi đại học để tuyển sinh vào đại học.

# // $KẾT LUẬN: ta thấy môn toán là môn được ưu tiên nhiều và được thí sinh chăm chú rèn luyện nhiều hơn các môn khác nên cả 3 tỉnh đều giữ được mức điểm toán rất cáo, riêng các môn khác như hóa và lý thì rất ít các khối thi đại học xét tuyển có chứa môn này nên thí sinh không rèn luyện thi nhiều nên các mức điểm của 3 tỉnh đều thấp so với các môn chính
